    def longestDupSubstring(self, S: str) -> str:

        n = len(S)
        smallest_length, greatest_length = 0, n
        solution = ""
        q = 2**31-1

        # Want to find largest length that has solution.
        while smallest_length < greatest_length - 1:
            mid = (smallest_length + greatest_length) // 2
            hassol, candidate = self.RabinKarp(S, mid, q)
            if hassol:
                solution = candidate
                smallest_length = mid
            else:
                greatest_length = mid

        return solution


